import React, { Component } from "react";
import Navigation from "./Navigation";

export default class About extends Component {
  render() {
    return (
      <div>
        <Navigation />

        <div className="content weights">
          <h1 className="text-white p-5 text-center font-weight-bolder">
            About Us
          </h1>
          <div className="d-flex flex-row m-5 img-avatar">
            <div className="img-self">
              <img
                src={require("../data/IMG_1341.jpg")}
                alt="profileAvatar"
                className="img-fluid img-thumbnail rounded-circle"
              />
            </div>
            <div className="d-flex flex-column m-5">
              <h2>Brandon Tsai</h2>
              <p>
                Lorem ipsum dolor sit amet consectetur, adipisicing elit. Natus
                molestias facere cumque quae sapiente vitae at eligendi maxime,
                iste, enim optio quas minima! Necessitatibus, nemo?
              </p>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
